import {Home} from './pages/Home'
import {NewRoom} from './pages/NewRoom'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Home/>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
